#include "menger.h"

/**
 * menger - function that draws a 2D Menger Sponge
 * @level: the level of the Menger Sponge to draw
 * Return - void
 */

void menger(int level)
{
	if (level < 0)
		return; /* condition */

	if (level == 0)
		printf("#\n");

	if (level == 1)
	{
		level_1();
	}
    if (level == 2)
	{
		level_2();
	}
    if (level == 3)
	{
		level_3();
	}
    if (level == 4)
	{
		level_4();
	}
    if (level == 5)
	{
		level_5();
	}
}

/**
 * level_1 - print a level 1 sponge
 * Return - void
 */

void level_1(void)
{
	{
		printf("###\n");
		printf("# #\n");
		printf("###\n");
	}
}

